@ian 105 돈을 지금은 퍼주고있는게맞죠 일자리 창출한다고 세금 54조쓰면서 노인일자리 90퍼센트만들면서 복지예산으로 써놓고 일자리 늘었다고 사기를 치지를 않나. 부자에게 고세율을 부과하는걸 뭐라하는게 아니고, 지금 선진국중에 가장 높은 세율을 우리나라에서 부과하고있다는걸 문제삼는겁니다. 개개인의 노력만 강조한거도 아닙니다. 국가가 그래서 수정자본주의로 복지를 충분히 하고있습니다. 부족하다고 하셨는데 선진국중에 가장 크게 부자들이 부담을 하고있는데 더부족하다고 하시는건 자본주의에서는 있을수없는일이라는겁니다. 또한 부의 재분배거리시는데 그래서 지금 문재인정권이 소득주도성장이라는 요상한 정책을 들고나와서 이명박근혜때보다도 경제성장률이 낮아지고 있죠. 저는 통계적으로 보여드리는 겁니다. 저도 인문학쪽 전공하고 석사까지나와서 그래도 공부한편인데, 계속 아리스토텔레스 목적론 복지국가론 이야기하시는데 이전 이론들이 현재에는 적용되지 않는 것도 많습니다. 
그래서 현정부가 최선을 다해서 저런것들을 실천해서 지금 현재 국채비울이 40퍼이상이되어가는데, 박근혜때 국채 36퍼일때는 맹비난을했었는데 앞뒤가 맞지가 않는거같네요ㅋㅋㅋ 다 차치하고 지금정부의 정책때문에 통계적으로 경제성장률은 떨어졌고, 국채비율은 늘어났고, 세금은 소득세 제산세 연금 건강보험등 계속 오르고있죠. 일자리도 노인일자리 말고는 더 줄어들었죠. 또한 부동산가격도 문정부 들어와 2배에서 3배 올라 잡지못하고, 오히려 이런정책으로 인해 소득양극화는 더 심해졌습니다. 고로 이런 정책은 현재 맞지 않는다는겁니다. 제가 기사와 자료까지 떠먹여가면서 보여드리지 않아도 이건 다 나와있는 자료기 때문에 찾아보시길 바라구요.  
그리고 제가 지금 관심이 많아보인다고 추천해주셨는데 유시민이란 조국 수호하고 굉장히 한쪽으로 치우치고소리만하는 작자가 쓴 책은 읽고 싶지도 않습니다. 그런 책을 추천해주신걸 보니, 한쪽에 굉장히 치우친 생각을 하시는분같은데 양쪽을 보실수있기를 바라요.

