@라림  동물보호규제를 통해 악어포획의 개수는 정해져있으며 문제가되는부분은 아시다싶이 불법포획입니다. 따라서 현재 에르메스에서 공급하는가죽은 불법포획가죽이아니며 국제동물보호법에 기준하여 법적으로문제가 없습니다. 아시다싶이 가장많이사용되고 등급과가격이 높은 카프라던지 코도반도 마찬가지입니다.
윗분이 말을 너무험하고 일반화시켜서 얘기하신부분은 있지만 사실상 가죽제품은 명품브랜드 수익과 가장크게연관되는 부분중 하나로써 경제에서 패션잡화가 차지하는 비중을 생각한다면 규모를 무시할수없습니다. 
그래서 동물보호법도 많은 분들이 모여서 재정을 하였고 우리도 인용을 할 필요가 있다고생각합니다. 물론 댓글작성자분도 무작정 가죽은쓰지마!라고 하는건 아니겠지만요. 제의도가 정확히 전달될수있었으면 합니다. 한국떠나 뉴저지에서 산지 오래되어서 문맥의흐름이 뒤죽박죽입니다
